      setMyList(skill);
      });
    }, [myList]);

  return (
    <>
      {myList.map((skill, index) => {
       console.log(skill,index)
       return (
          <li key={index}>{skill}</li>
        );
      })}
    </>
  );
};

export default ArrayMap;
